import React from "react";
import Back from "../../img/back.png";
import "./Product.css";
import { Link } from "react-router-dom";
const Product = () => {
  return (
    <div className="Product">
      <div className="lang-background">
        <Link to="/Lang">
          <div className="btn-back">
            <img src={Back} alt="" />
          </div>
        </Link>
        <p>Select product</p>
      </div>
    </div>
  );
};

export default Product;
